import style from "./Checkout.module.css";


const Checkout = ()=>{
    return(
        <div id={style.Checkout}>
            <div>
                <div>
                    <label>
                        <h1>Metodo de pago</h1>
                    </label>
                </div>
            </div>
        </div>
    )
};

export default Checkout;
